import React, { useEffect, useState } from 'react';
import { getDatabase, ref, onValue, remove } from 'firebase/database';
import { getAuth, onAuthStateChanged } from 'firebase/auth';
import { useNavigate } from 'react-router-dom';
import MainAcademics from './MainAcademics';
import './ShowAnalysis.css';

function ShowAnalysis() {
  const [data, setData] = useState({});
  const [semesters, setSemesters] = useState([]);
  const [years, setYears] = useState([]);
  const [error, setError] = useState(null);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const auth = getAuth();
    const unsubscribe = onAuthStateChanged(auth, (user) => {
      if (user) {
        setIsLoggedIn(true);
      } else {
        setIsLoggedIn(false);
      }
    });

    return () => unsubscribe();
  }, []);

  useEffect(() => {
    const db = getDatabase();
    const resultsRef = ref(db, 'analysis');

    onValue(resultsRef, (snapshot) => {
      const results = snapshot.val();
      if (results) {
        setData(results);

        // Extract unique semesters and years for headers
        const uniqueSemesters = Array.from(
          new Set(
            Object.values(results).flatMap(item => item.semesters ? Object.keys(item.semesters) : [])
          )
        );
        const uniqueYears = Object.keys(results);

        setSemesters(uniqueSemesters);
        setYears(uniqueYears);
      }
    });
  }, []);

  const handleDelete = (year, semester) => {
    if (!isLoggedIn) {
      alert('You must be logged in to delete analysis.');
      return;
    }

    const db = getDatabase();
    const resultRef = ref(db, `analysis/${year}/semesters/${semester}`);
    remove(resultRef)
      .then(() => {
        setData(prevData => {
          const updatedData = { ...prevData };
          delete updatedData[year].semesters[semester];
          if (Object.keys(updatedData[year].semesters).length === 0) {
            delete updatedData[year];
          }
          return updatedData;
        });
      })
      .catch((error) => {
        setError('Error deleting analysis: ' + error.message);
      });
  };

  const handleUpdate = (year, semester) => {
    if (!isLoggedIn) {
      alert('You must be logged in to update analysis.');
      return;
    }

    navigate(`/updateanalysis/${year}/${semester}`);
  };

  return (
    <div className="syllabus-container">
      <MainAcademics />
      {isLoggedIn && (
        <h2><a href="/addanalysis">Click to Add Results</a></h2>
      )}
      <h1 className="syllabus-header">Result Analysis</h1>
      {error && <p className="error-message">{error}</p>}
      <table className="syllabus-table">
        <thead>
          <tr>
            <th>Admission Year</th>
            {semesters.map(semester => (
              <th key={semester}>{semester}</th>
            ))}
            {isLoggedIn && <th>Actions</th>}
          </tr>
        </thead>
        <tbody>
          {years.map(year => (
            <tr key={year}>
              <td>{year}</td>
              {semesters.map(semester => (
                <td key={`${year}-${semester}`}>
                  {data[year]?.semesters?.[semester] ? (
                    <a 
                      href={data[year].semesters[semester]} 
                      target="_blank" 
                      rel="noopener noreferrer">
                        View PDF
                    </a>
                  ) : (
                    <span> - </span>
                  )}
                </td>
              ))}
              {isLoggedIn && (
                <td>
                  {semesters.map(semester => (
                    data[year]?.semesters?.[semester] && (
                      <div key={`${year}-${semester}-actions`}>
                        <button 
                          key={`${year}-${semester}-delete`} 
                          onClick={() => handleDelete(year, semester)}>
                          Delete
                        </button>
                        <button 
                          key={`${year}-${semester}-update`} 
                          onClick={() => handleUpdate(year, semester)}>
                          Update
                        </button>
                      </div>
                    )
                  ))}
                </td>
              )}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ShowAnalysis;
